(function(){app.modals.CreateOrEditCountryModal=function(){var n,i=abp.services.app.country,t=null;this.init=function(i){n=i;t=n.getModal().find("form[name=countryInformationsForm]");t.validate({ignore:""})};this.save=function(){if(t.valid()){var r=t.serializeFormToObject();n.setBusy(!0);i.createOrUpdateCountry({country:r}).done(function(){abp.notify.info(app.localize("SavedSuccessfully"));n.close();abp.event.trigger("app.createOrEditCountryModalSaved")}).always(function(){n.setBusy(!1)})}}}})();